import React from "react";

class Todo extends React.Component {
  state = {
    task: "",
  };
  render() {
    let { menuObj } = this.props;
    console.log(menuObj);
    console.log(typeof menuObj);
    if (menuObj.menu === "home") {
      return (
        <>
          <p>Homeeeeeeeeeeeeeeeee</p>
        </>
      );
    }
    if (menuObj.menu === "todo") {
      return (
        <>
          <div>
            <p>There are my tasks</p>

            <div className="input-div">
              <input
                type="text"
                className="form-control"
                placeholder="Input task here"
                value={this.state}
              />
              <button className="btn btn-primary" disabled="true">
                ADD
              </button>
            </div>

            <div class="list-group">
              <a className="list-group-item">First item</a>
              <a className="list-group-item">Second item</a>
              <a className="list-group-item">Third item</a>
            </div>
          </div>
        </>
      );
    }
  }
}
export default Todo;
